import React from "react"

const TodoItem = props =>{
    return(
        <li style={{textDecoration: props.completed ? "line-through": "none"}}>
            {props.name}
            <span onClick={props.deleteTodo(props.key)}>X</span>
        </li>
    )
}

export default TodoItem
